sys_variable_value.value:
(function execute(inputs, outputs) {
  var allowedPatternForFolderDispName = /[\p{L}\p{N}]([\p{L}\p{N}_- ]{0,28}[\p{L}\p{N}])?;
  if (!allowedPatternForFolderDispName.test(displayName)) {
    throw new Error("Name of the folder is in /^folders\/[^/]+$/ format : " + inputs.displayName); 
  }
})(inputs, outputs);

